import React from "react";
import './education.css'

function Education(){
    return(
        <div className="education-contenedor">
            <div className="education-apartado">Nefasta</div>
            <div className="education-apartado">Tecnicatura</div>
            <div className="education-apartado">curso vegano 1</div>
            <div className="education-apartado">curso vegano 2</div>
            <div className="education-apartado">curso vegano 3</div>
            <div className="education-apartado">curso dalto y gorda de react</div>
        </div>
    );
};

export default Education;
